  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'angular-tour-of-heros';
}
<body>
  <nav class="navbar">
    <a href="">Home</a>
    <a href="/quote">Create a Quote</a>
    <a href="/admindash">Admin</a>
    <a href="/login">Login</a>
  </nav>
  <div class="container">
    <router-outlet></router-outlet>
  </div>  
</body>
